\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut then, just like his namesake on the road to Damascus, he felt the calling. He became a physician instead, but one who always dreamed of coming back to literature in some form. A book, perhaps. One day. He thought he had time, and why not? And yet now time was the very thing he had so little of.\n\nFebruary 26, 2017\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe said during medical school he’d assumed that he would become a psychiatrist, only to fall in love with neurosurgery\n\nFebruary 26, 2017\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit was a love and empathy for those who suffered, for what they endured and what he might bring to bear. I don’t think he told me this as much as I had heard about this quality of his from students of mine who were his acolytes: his fierce belief in the moral dimension of his job. And then we talked about his dying\n\nFebruary 26, 2017\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the silences between his words, listen to what you have to say back. Therein lies his message. I got it. I hope you experience it, too. It is a gift. Let me not stand between you and Paul\n\nFebruary 26, 2017\n\u001c14\n\u0011\n\u0011\n\n\nPart I: In Perfect Health I Begin\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt was not a simple evil, however. All of medicine, not just cadaver dissection, trespasses into sacred spheres. Doctors invade the body in every way imaginable. They see people at their most vulnerable, their most scared, their most private. They escort them into the world, and then back out. Seeing the body as matter and mechanism is the flip side to easing the\n\nFebruary 26, 2017\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmost profound human suffering. By the same token, the most profound human suffering becomes a mere pedagogical tool.\n\nFebruary 26, 2017\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cReading books and answering multiple-choice questions bore little resemblance to taking action, with its concomitant responsibility. Knowing you need to be judicious when pulling on the head to facilitate delivery of the shoulder is not the same as doing it. What if I pulled too hard? (Irreversible nerve injury, my brain shouted.)\n\nFebruary 27, 2017\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Was it the right choice, to do an emergency C-section?” I asked. “No question,” she said. “It was the only shot they had.” “What happens if you don’t?” “Probably, they die. Abnormal fetal heart tracings show when the fetal blood is turning acidemic; the cord is compromised somehow, or something else seriously bad is happening.” “But how do you know when the tracing looks bad enough? Which is worse, being born too early or waiting too long to deliver?” “Judgment call.”\n\nFebruary 27, 2017\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat a call to make. In my life, had I ever made a decision harder than choosing between a French dip and a Reuben? How could I ever learn to make, and live with, such judgment calls? I still had a lot of practical medicine to learn, but would knowledge alone be enough, with life and death hanging in the balance? Surely intelligence wasn’t enough; moral clarity was needed as well. Somehow, I had to believe, I would gain not only knowledge but wisdom, too. After all, when I had walked into the hospital just one day before, birth and death had been merely abstract concepts. Now I had seen them both up close.\n\nFebruary 27, 2017\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the fourth year of medical school, I watched as, one by one, many of my classmates elected to specialize in less demanding areas (radiology or dermatology, for example) and applied for their residencies. Puzzled by this, I gathered data from several elite medical schools and saw that the trends were the same: by the end of medical school, most students tended to focus on “lifestyle” specialties—those with more humane hours, higher salaries, and lower pressures—the idealism of their med school application essays tempered or lost.\n\nFebruary 27, 2017\n\u001c53\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1AldVL63X6sM0Ptn9a-ysE4eWTuf8d0iiXvZ7IKQ","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1X-O4TCATZGF7FiJBrt1DU_bKsaRKQtiuu441jiM","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":23.333333333333332,"i_rot":0.0,"i_clst":{"cv":{"op":"set"