odelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU"  nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU"  nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU">DOCS_modelChunk = [{"ty":"is","ibi":4134,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIndeed, this is how 99 percent of people select their jobs: pay, work environment, hours. But that’s the point. Putting lifestyle first is how you find a job—not a calling.)\n\nFebruary 27, 2017\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut in residency, something else was gradually unfolding. In the midst of this endless barrage of head injuries, I began to suspect that being so close to the fiery light of such moments only blinded me to their nature, like trying to learn astronomy by staring directly at the sun. I was not yet with patients in their pivotal moments, I was\n\nFebruary 27, 2017\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmerely at those pivotal moments. I observed a lot of suffering; worse, I became inured to it. Drowning, even in blood, one adapts, learns to float, to swim, even to enjoy life, bonding with the nurses, doctors, and others who are clinging to the same raft, caught in the same tide.\n\nFebruary 27, 2017\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI feared I was on the way to becoming Tolstoy’s stereotype of a doctor, preoccupied with empty formalism, focused on the rote treatment of disease—and utterly missing the larger human significance.\n\nFebruary 27, 2017\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA mother came to me, newly diagnosed with brain cancer. She was confused, scared, overcome by uncertainty. I was exhausted, disconnected. I rushed through her questions, assured her that surgery would be a success, and assured myself that there wasn’t enough time to answer her questions fairly. But why didn’t I make the time? A truculent vet refused the advice and coaxing of doctors, nurses, and physical therapists for weeks; as a result, his back wound broke down, just as we had warned him it would. Called out of the OR, I stitched the dehiscent wound as he yelped in pain, telling myself he’d had it coming. Nobody has it coming\n\nFebruary 27, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTechnical excellence was not enough. As a resident, my highest ideal was not saving lives—everyone dies eventually—but guiding a patient or family to an understanding of death or illness. When a patient comes in with a fatal head bleed, that first conversation with a neurosurgeon may forever color how the family remembers the death, from a peaceful letting go (“Maybe it was his time”) to an open sore of regret (“Those doctors didn’t listen! They didn’t even try to save him!”). When there’s no place for the scalpel, words are the surgeon’s only tool.\n\nFebruary 27, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHad I been more religious in my youth, I might have become a pastor, for it was the\n\nFebruary 27, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpastoral role I’d sought.\n\nFebruary 27, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cto my father. As medical students, Lucy and I had attended his hospital rounds in Kingman, watching as he brought comfort and levity to his patients. To one woman, who was\n\nFebruary 27, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Well, how about lobster and steak?” He picked up the phone and called the nursing station. “My patient needs lobster and steak—right away!” Turning back to her, he said, with a smile: “It’s on the way, but it may look more like a turkey sandwich.” The easy human connections he formed, the trust he instilled in his patients, were an inspiration to me.\n\nFebruary 27, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI gathered her family with her, and together we calmly talked through the options. As we talked, I could see the enormousness of the choice she faced dwindle into a difficult but understandable decision. I had met her in a space where she was a person, instead of a problem to be solved\n\nFebruary 27, 2017\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthat I didn’t expect them to retain anything I had just said and we’d go over everything again. After surgery, we talked again, this time discussing chemo, radiation, and prognosis. By this point, I had learned a couple of basic rules. First, detailed statistics are for research halls, not hospital rooms. The standard statistic, the Kaplan-Meier curve, measures the number of patients surviving over time. It is the metric by which we gauge progress, by which we understand the ferocity of a disease. For glioblastoma, the curve drops sharply until only about 5 percent of patients are alive at two years.\n\nFebruary 27, 2017\n\u001c69\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4143},{"ty":"te","id":"i.13","spi":4355},{"ty":"te","id":"i.14","spi":4392},{"ty":"te","id":"i.15","spi":4773},{"ty":"te","id":"i.16","spi":5093},{"ty":"te","id":"i.17","spi":5329},{"ty":"te","id":"i.18","spi":6004},{"ty":"te","id":"i.19","spi":6598},{"ty":"te","id":"i.20","spi":6635},{"ty":"te","id":"i.21","spi":6757},{"ty":"te