_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7426,"ei":7444,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7463,"ei":7750,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7751,"ei":7769,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7788,"ei":7806,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7825,"ei":8433,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8434,"ei":8452,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU"  nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU"  nonce="4NX9fU/zfuJ5/NNWFAO7KVa2vBU">DOCS_modelChunk = [{"ty":"is","ibi":8459,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSecond, it is important to be accurate, but you must always leave some room for hope. Rather than saying, “Median survival is eleven months” or “You have a ninety-five percent chance of being dead in two years,” I’d say, “Most patients live many months to a couple of years.” This was, to me, a more honest description\n\nFebruary 27, 2017\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI don’t think I ever spent a minute of any day wondering why I did this work, or whether it was worth it. The call to protect life—and not merely life but another’s identity; it is perhaps not too much to say another’s soul—was obvious\n\nFebruary 27, 2017\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBefore operating on a patient’s brain, I realized, I must first understand his mind: his identity, his values, what makes his life worth living, and what devastation makes it reasonable to let that life end. The cost of my dedication to succeed was high, and the ineluctable failures brought me nearly unbearable guilt. Those burdens are what make medicine holy and wholly impossible: in taking up another’s cross, one must sometimes get crushed by the weight.\n\nFebruary 27, 2017\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAfter I’d been there for a year, V and I sat down for one of our weekly meetings. I had grown to love these chats. V was not like other scientists I knew. He was soft-spoken and cared deeply about people and the clinical mission, and he often confessed to me that he wished he’d been a surgeon himself. Science, I had come to learn, is as political, competitive, and fierce a career as you can find, full of the temptation to find easy paths\n\nFebruary 27, 2017\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe paused. “Paul,” he said, “do you think my life has meaning? Did I make the right choices?” It was stunning: even someone I considered a moral exemplar had these questions in the face of mortality. V’s surgery, chemotherapy, and radiation treatments were trying, but a success. He was back at work a year later, just as I was returning to my clinical duties in the hospital. His hair had thinned and whitened, and the spark in his eyes had dulled. During our final weekly chat, he turned to me and said, “You know, today is the first day it all seems worth it. I mean, obviously, I would’ve gone through anything for my kids, but today is the first day that all the suffering seems worth it.”\n\nFebruary 27, 2017\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe pain of failure had led me to understand that technical excellence was a moral requirement. Good intentions were not enough, not when so much depended on my skills, when the difference between tragedy and triumph was defined by one or two millimeters\n\nFebruary 27, 2017\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLocked-in syndrome.” Another two millimeters, and the patient\n\nFebruary 27, 2017\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwould be completely paralyzed, save for the ability to blink. He didn’t look up from the microscope. “And I know this because the third time I did this operation, that’s exactly what happened.” Neurosurgery requires a commitment to one’s own excellence and a commitment to another’s identity. The decision to operate at all involves an appraisal of one’s own abilities, as well as a deep sense of who the patient is and what she holds dear. Certain brain areas are considered near-inviolable, like the primary motor cortex, damage to which results in paralysis of affected body parts. But the most sacrosanct regions of the cortex are those that control language. Usually located on the left side, they are called Wernicke’s and Broca’s areas; one is for understanding language and the other for producing it. Damage to Broca’s area results in an inability to speak or write, though the patient can easily understand language\n\nFebruary 27, 2017\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 27, 2017\n\u001c80\n\u0011\n\u0011\n\n\nPart II: Cease Not till Death\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy life had been building potential, potential that would now go unrealized.\n\nFebruary 27, 2017\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYears ago, it had occurred to me that Darwin and Nietzsche agreed on one thing: the defining characteristic of the organism is striving. Describing life otherwise was like\n\nFebruary 27, 2017\n\u001c96\n\u0011\n\u0011"},{"ty":"te","id":"i.28","spi":8468},{"ty":"te","id":"i.29","spi":8505},{"ty":"te","id":"i.30","spi":8862},{"ty":"te","id":"i.31","spi":9136},{"ty":"te","id":"i.32","spi":9635},{"ty":"te","id":"i.33","spi":10115},{"ty":"te","id":"i.34","spi":10848},{"ty":"te","id":"i.35","spi":10885},{"ty":"te","id":"i.36","spi":10922},{"ty":"te","id":"i.37","spi":11215},{"ty":"te","id":"i.38","spi":11315},{"ty":"te","id":"i.39","spi":12279},{"ty":"te","id":"i.40","spi":12348},{"ty":"te","id":"i.41","spi":12463},{"ty":"as","st":"paragraph","si":8459,"ei":8459,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8460,"ei":8460,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8461,"ei":8461,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty"